import React from 'react';
import { Row } from 'reactstrap';
import useFetch from '../hooks/useFetch'; // Uvezi useFetch hook
import TourCard from '../shared/TourCard'; // Koristi TourCard komponentu za prikazivanje tura
import { BASE_URL } from '../utils/config'; // Uvezi BASE_URL

const Home = () => {
  const { data: tours, loading, error } = useFetch(`${BASE_URL}/tours`);

  if (loading) {
    return <h4>Loading...</h4>;
  }

  if (error) {
    return <h4>{error}</h4>;
  }

  return (
    <div className="home-container">
      <h2>Nase Ture</h2>
      <Row>
        {tours?.map((tour) => (
          <TourCard key={tour._id} tour={tour} />
        ))}
      </Row>
    </div>
  );
};

export default Home;
